import React from 'react'
import {Link} from 'react-router-dom'
import {Nav, Navbar, NavDropdown } from 'react-bootstrap';

const NavBar = () => {

    const menuRoll=()=>{
    <div className='menuRoll'>
        <h2>hello</h2>
    </div>
}
    return (
        <div className='navbar'>
        <Link className='text-link' to='/'><img height='30px' style={{marginLeft:'90px'}}
         src='https://uploads-ssl.webflow.com/5f0c8ee786502d713c4bbd11/5f511c7aa071402caf19508f_Logo%20Enalia.svg'
        alt='logo' /> </Link>

        <div className='d-flex justify-content-end'>
        <h6 className='text-link' onMouseEnter={()=>menuRoll()}> MENU</h6> &nbsp; &nbsp;


       <Link className='text-link' to='/contact'> <h6>CONTACT</h6> </Link>
        </div>

        const [showDropdown, setShowDropdown] = useState(false);
  return (
    <Dropdown
      onMouseLeave={() => setShowDropdown(false)}
      onMouseOver={() => setShowDropdown(true)}
      style={{ width: '166px' }}
    >
      <Dropdown.Toggle
        className="main-style"
        id="dropdown-basic"
      >
        Dropdown Button
      </Dropdown.Toggle>

      <Dropdown.Menu show={showDropdown}>
        <Dropdown.Item href="#/action-1">
          Action
        </Dropdown.Item>
        <Dropdown.Item href="#/action-2">
          Another action
        </Dropdown.Item>
        <Dropdown.Item href="#/action-3">
          Something else
        </Dropdown.Item>
      </Dropdown.Menu>
    </Dropdown>
  );

        </div>
    )
}

export default NavBar
